import React, { Component } from 'react'
import Layout from '../components/layout.js'
import Test from './app'

const numbers = [1, 2, 3, 4, 5, 6];

function ListItem(props) {
    return <li>{props.value}</li>;
}



function NumberList(props) {
    const numbers = props.numbers;

    return(
        <ul>
            {numbers.map((number) =>
                <ListItem key={number.toString()}
                value={number} />
                )}
        </ul>
    );
}

class Testpage extends Component {
    constructor(props) {
        super(props);
        this.state = {boxactive: false}
        this.boxonclick = this.boxonclick.bind(this);
    }
    
        
        
    

    boxonclick() {
        this.setState = ({boxactive: true});
    }

    render() {
        return (
            <Layout>
                <h1>This page is for current dev projects</h1>
                <div id="Test">
                    <Test />
                </div>
                <div>
                    <NumberList numbers={numbers} />
                </div>
                <div>
                    <button onClick={this.boxonclick}>
                    {this.state.boxactive ? 'Hide' : 'Show'}
                    </button>
                </div>
                    <div>
                    <img className="box" src="https://www.google.com/images/srpr/logo11w.png" width="100"/>
                     
                </div>
            </Layout>
        )
    }
}


export default Testpage;
